import './App.css';
import Minter from './Minter'
import {UploadToIPFS} from './IPFSUpload'
import ReactDOM from 'react-dom'

function App() {
  return (
    <div className="App">
      <Minter></Minter>
      <div>
        <UploadToIPFS></UploadToIPFS>
      </div>
    </div>
  );
}

export default App;
